import React from 'react';

function Auth(props) {
    return (
        <div className='container-fluid pt-5 auth-cont'>
            <div className='pt-5 container d-flex justify-content-center align-items-center'>
                <div className='d-flex justify-content-center align-items-center flex-column gap-5 auth-div'>
                    <h3>Authentication</h3>
                    
                    <span>or</span>
                    <form className='d-flex justify-content-center align-items-center flex-column gap-4'>
                        <input type='text' placeholder='username'/>
                        <input type='password' placeholder='password'/>
                        <button type='submit'>GO!</button>
                    </form>
                </div>
                
            </div>
        </div>
    );
}

export default Auth;
